(11, 13446773, ' Дом введен в эксплуатацию. Строительная компания', 'empty_', 7895561, 'грн', 41775, 3, 189, 12, 12, 'Вторичный рынок', 'Одесса', 'Приморский', 'Французский бульвар,2', 'Дом введен в эксплуатацию. Строительная компания &quot;ЗАРС&quot;, &quot;Дома Каркашадзе&quot;. Уникальный дом из красного кирпича в элитном районе на Французском бульваре. Все стены из красного кирпича, толщина 640 мм. Высота помещений 3,2 м. Все холлы, коридоры и лестницы отделаны мрамором. Панорамные окна из натурального дерева (евробрус), двухкамерные энергосберегающие стеклопакеты. Эргономичная планировка. Вид на море. Бесшумные скоростные лифты. Охраняемая территория, контроль доступа, видеонаблюдение. Ландшафтный дизайн, фонтан, детская площадка. Гостевой паркинг, подземный паркинг. Полная автономия, индивидуальная газовая котельная, запас воды, аварийное энергоснабжение (2 ввода), дизель генератор, высокая сейсмостойкость. Состояние квартир - от строителей. Прокладка сетей отопления и водоснабжения в стяжке пола, дополнительная тепло-звукоизоляция стяжки (ISOLON), итальянские алюминиевые радиаторы, приборы учета, штукатурка, бронированные двери. Трехфазный ввод электричества в квартиру, интернет, тв, телефон, домофон.', 'Состояние', 'кирпич', 'Частного лица', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-primorskiy-frantsuzskiy-bulvar2-13446773.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-frantsuzskiy-bulvar2__76895505fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-frantsuzskiy-bulvar2__76895508fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-frantsuzskiy-bulvar2__76895512fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-frantsuzskiy-bulvar2__76895518fl.jpg","https:\\/\\/cdn.riastatic.com\\/ph