(13, 13570056, ' Три спальни (16, 17, 14), ванная', 'empty_', 7310705, 'грн', 66460, 3, 110, 17, 22, 'Вторичный рынок', 'Одесса', 'Приморский', 'Гагаринское плато', 'Три спальни (16, 17, 14), ванная комната - 6 м + душевая комната в одной из спален, гостиная + кухня-студия + обеденная зона\nАвторский дизайн, кондиционеры, люстры, ленточное освещение по периметру квартиры; встроенная дорогая кухня, техника Siemens, Smeg, Bosch, встроенные два холодильника, дизайнерские шкафы и шторы \nЖивописный панорамный вид на море по всей квартире с восходом солнца \nПредоставление безопасности в виде охраны и видеонаблюдения + паркинг в доме \n5 минут ходьбы к морю, Трассе здоровья, Аркадии. Школа, детский сад, множество магазинов в шаговой доступности', 'Состояние', 'пеноблок', 'Частного лица', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-primorskiy-gagarinskoe-plato-13570056.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-gagarinskoe-plato__78083411fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-gagarinskoe-plato__78083413fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-gagarinskoe-plato__78083415fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-gagarinskoe-plato__78083417fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-gagarinskoe-plato__78083420fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-gagarinskoe-plato__78083421fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-gagarinskoe-plato__78083424fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-gagarinskoe-plato