(15, 13496164, ' Строительная компания &quot;ЗАРС&quot;, &quot;Дома Каркашадзе&quot;. Уникальный', 'empty_', 11738903, 'грн', 41775, 3, 281, 12, 12, 'Вторичный рынок', 'Одесса', 'Приморский', 'переулок Каркашадзе, 9', 'Строительная компания &quot;ЗАРС&quot;, &quot;Дома Каркашадзе&quot;. Уникальный дом из красного кирпича в элитном районе на Французском бульваре.\nДом сдан в 2011 году.\nСостояние квартиры – от строителей.\nВсе стены из красного кирпича, толщина 640 мм. Высота помещений 3,2 м. Все холлы, коридоры и лестницы отделаны мрамором. Панорамные окна из натурального дерева. Эргономичная планировка. Вид на море. Бесшумные скоростные лифты. Охраняемая территория, видеонаблюдение.\nЛандшафтный дизайн, фонтан, детская площадка. Гостевой паркинг, подземный паркинг. Полная автономия, индивидуальная газовая котельная, высокая сейсмостойкость.', 'Состояние', 'кирпич', 'Частного лица', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-primorskiy-pereulok-karkashadze-9-13496164.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-pereulok-karkashadze-9__77341616fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-pereulok-karkashadze-9__77341630fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-pereulok-karkashadze-9__77341635fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-pereulok-karkashadze-9__77341636fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-pereulok-karkashadze-9__77341640fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-pereulok-karkashadze-9__77341643fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-pereulok-karkash