(16, 12270645, ' Новый сданный дом, с экономией на', 'empty_', 939948, 'грн', 15408, 2, 61, 11, 15, 'Вторичный рынок', 'Одесса', 'Киевский', 'Радужная улица', 'Новый сданный дом, с экономией на отоплениии и горячей воде за счет установленных на крыше солнечных коллекторов, что немаловажно при нынешних ценах на газ. В парадной два лифта: пассажирский и грузовой. Квартира расположена в середина дома с видом во двор. Комнаты изолированные. С/у раздельный. Из комнаты выход в пяти метровую лоджию, застекленную. Выполнены все работы под чистовую отделку. Бронированная дверь, стяжка залита под чистовую отделку, стены отштукатурены под покраску, метало-пластиковое остекление. Двор закрытого типа. Подземный паркинг. \nПод итожим: Вы ищите полноценную двухкомнатную квартиру, в которой вы не будете иметь проблем со старой сантехникой, грязными и разрисованными парадными и лифтами, ямами во дворе и поломанными детскими площадками, сумасшедшими коммунальными платежами, и чтобы цена этой квартиры была ниже рыночной (срочной), тогда этот вариант идеально подходит Вам! \n', 'Состояние', 'газобетон', 'Частного лица', '********', '********', 'https://dom.ria.com/ru/realty-perevireno-prodaja-kvartira-odessa-kievskiy-radujnaya-ulitsa-12270645.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-kievskiy-radujnaya-ulitsa__65421635fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-kievskiy-radujnaya-ulitsa__65421640fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-kievskiy-radujnaya-ulitsa__65421655fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-kievskiy-radujnaya-ulitsa__65421658fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-kievskiy-radujnaya-ulitsa__65421661fl.jpg","https:\\/\\/cdn.r