(23, 13507306, ' Продам шикарную квартиру: кухня-студия + спальня', 'empty_', 2245431, 'грн', 41582, 1, 54, 6, 14, 'Вторичный рынок', 'Одесса', 'Киевский', 'Левитана улица', 'Продам шикарную квартиру: кухня-студия + спальня в новом кирпичном доме &quot;Каскад&quot;, на Королева/Левитана. 6 этаж 16-этажного дома. Площадь квартиры 55 кв.м. Кухня-студия 34 кв.м. Спальня 14 кв.м. В спальне - большая, благоустроенная гардеробная. Из кухни выход на лоджию. Она утеплена, застеклена м/пластиком. Санузел совмещен, современно облицован. В квартире выполнен дорогой дизайнерский ремонт. Использованы только качественные стройматериалы. Плитка и ламинат, фактурная и венецианская штукатурка, точечная подсветка. Две гардеробные. Квартира укомплектована новой, современной, дорогой мебелью и техникой. Остается все, что есть в квартире: два плазменных телевизора, встроенный холодильник, посудомоечная машина. Дорогая встроенная кухня, все шкафчики с доводчиками. Барная стойка. Кондиционер. Мягкий уголок. Вся мебель в ванной комнате. Все люстры, светильники и занавески. Очень красивая, стильная квартира! Делали ремонт и укомплектовывали для себя!\nИдеально для жизни, отдыха и для бизнеса  Цена 86 тыс у.е.!   № 73 889', 'Состояние', 'кирпич', 'Частного лица', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-kievskiy-levitana-ulitsa-13507306.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-kievskiy-levitana-ulitsa__77456779fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-kievskiy-levitana-ulitsa__77456886fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-kievskiy-levitana-ulitsa__77456890fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-kievskiy-levitana-ulitsa__77456892fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira