(24, 13442367, ' Предлагается к продаже уютная 2-х комнатная', 'empty_', 1436031, 'грн', 25643, 2, 56, 14, 16, 'Вторичный рынок', 'Одесса', 'Суворовский', 'Улица не определена', 'Предлагается к продаже уютная 2-х комнатная квартира \n в Ж/К &quot;Три Тополя&quot; по улице Днепродорога/Бочарова, 14й этаж 16ти этажного дома. Кухня объединена с залом (26 кв. м), спальня (15 кв. м). МТП окна, натяжные французские потолки, на полу ламинат, встроенная кухня, кондиционер, 4 больших шкафа купе (в прихожей, спальне и на лоджии), ванная и туалет облицованы мозаикой, бойлер. Квартира двухсторонняя, южная сторона, очень теплая. Лоджия и балкон застеклены. Остается мебель и встроенная бытовая техника. Отличное месторасположение, рядом садики, школы, рынки, супермаркеты и остановки общественного транспорта. Возможна аренда крытого места на охраняемой автостоянке. Парадная чистая, консьерж. Риэлторов и посредников просьба не беспокоить.', 'Состояние', 'монолит', 'Частного лица', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-suvorovskiy-13442367.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-suvorovskiy__76856883fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-suvorovskiy__76856932fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-suvorovskiy__76856939fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-suvorovskiy__76856953fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-suvorovskiy__76856960fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-suvorovskiy__76856967fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-suvorovskiy__76856982fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-pro