(52, 13220702, ' Кухня-студия + спальня\nДвухкомнатная квартира по цене', 'empty_', 809399, 'грн', 18395, 2, 44, 13, 16, 'Вторичный рынок', 'Одесса', 'Киевский', 'ЖК Радужный', 'Кухня-студия + спальня\nДвухкомнатная квартира по цене однокомнатной! Отличное расположение дома - первый ряд домов от Маршала Жукова, близко остановка и выезд на М. Жукова! Квартира восточная с прекрасным видом на город (редкость в Радужном!) . Компактная и удобная квартира с современной планировкой. Кухня-студия 23 кв.м и спальня 12 кв.м, санузел 4,2 кв.м. Прихожая 5 кв.м.\nСостояние: от строителей.\nМаксимально рациональное использование площади (нет лишних коридоров и переходов). Документы на перепланировку оформлены, прошли все согласования. Получено СПС на уже перепланированную квартиру. Покупали и делали реконструкцию для себя. Для себя планировали расстановку мебели. Преимущества квартиры: удобная планировка - покупаете двухкомнатную квартиру по цене однокомнатной. Расположение дома близко к М. Жукова, а не в полях . Вид из окна - открытое пространство, а не окна в окна\nID 59905', 'Состояние', 'кирпич', 'Бизнес', '********', '********', 'https://dom.ria.com/ru/realty-perevireno-prodaja-kvartira-odessa-kievskiy-jk-radujnyiy-13220702.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-kievskiy-jk-radujnyiy__74813144fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-kievskiy-jk-radujnyiy__74813193fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-kievskiy-jk-radujnyiy__74813196fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-kievskiy-jk-radujnyiy__74813198fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-kievskiy-jk-radujnyiy__74813201fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/d