(56, 13556240, ' Эксклюзивное предложение—двухуровневая квартира на улице Пироговской.', 'empty_', 2741514, 'грн', 27415, 4, 100, 3, 4, 'Вторичный рынок', 'Одесса', 'Приморский', 'Сельскохозяйственный переулок', 'Эксклюзивное предложение—двухуровневая квартира на улице Пироговской. Квартира расположена на 3 и 4 этажах 4 этажного крепкого дома с внутренним двориком. В доме в этом году отреставрирован фасад дома. Общая площадь 100 квадратных метра, 4 комнаты, жилая 63, кухня 8, гардеробная 5, 2 санузла, терраса 10 квадратных метра. Высота потолков 3,4 метра. В квартире выполнен капитальных ремонт, АОГВ, деревянна столярка, входная бронированная дверь, видеонаблюдение, сигнализация. С террасы открывается прекрасный вид на стадион СКА. Очень хорошие соседи-интеллигенты, доктора, парадная и двор всегда убраны, тихо и спокойно. В парадной мраморная лестница. Одно из лучших месторасположений—рядом исторический центр, пляжи, парки, вузы, школы. Одно из лучших предложений, такие квартиры уходят быстро, звоните и приходите сегодня!', 'Состояние', 'ракушечник (ракушняк)', 'Бизнес', '********', '********', 'https://dom.ria.com/ru/realty-perevireno-prodaja-kvartira-odessa-primorskiy-selskohozyaystvennyiy-pereulok-13556240.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-primorskiy-selskohozyaystvennyiy-pereulok__77950245fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-primorskiy-selskohozyaystvennyiy-pereulok__77950246fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-primorskiy-selskohozyaystvennyiy-pereulok__77950248fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-primorskiy-selskohozyaystvennyiy-pereulok__77950249fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-primorskiy-