(76, 13200169, ' id 72014\nПредлагается к продаже 3-комнатная квартира', 'empty_', 1618799, 'грн', 23805, 3, 68, 8, 9, 'Вторичный рынок', 'Одесса', 'Киевский', 'Маршала Жукова проспект', 'id 72014\nПредлагается к продаже 3-комнатная квартира в г.Одессе, в престижном спальном районе, на просп.М.Жукова/"Сити-центр". 8 этаж 9-этажного кирпичного дома, спецпроект, двусторонняя квартира, общая площадь 68.6м: гостиная 26м, частично объединена с кухней и с выходом на балкон, две отдельные спальни 15+10м, санузел совмещен, современно облицован, угловая ванная, бойлер, стиральная машина, прихожая 14м с тремя шкафами-купе. В квартире выполнен качественный ремонт, в стиле современной классики: наружная столярка - евробрус, мраморные подоконники, внутренняя столярка - дерево с витражами, французские натяжные потолки с точечным освещением, стены - дорогие обои, пол - ламинат+плитка. Рабочая стенка кухни современно облицована, установлена встроенная кухня и быттехника. Квартира укомплектована мебелью, два кондиционера. Входная дверь бронированная. Чистейшая парадная. Зеленый, благоустроенный двор, детская площадка. Рядом детсад, школа, сеть супермаркетов, торгово-развлекательный комплекс "Сити-центр", супертранспортная развязка. Квартира - заходи и живи! Идеальное предложение по соотношению цены и качества. Реальному покупателю - реальный торг.', 'Состояние', 'панель', 'Бизнес', '********', '********', 'https://dom.ria.com/ru/realty-perevireno-prodaja-kvartira-odessa-kievskiy-marshala-jukova-prospekt-13200169.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-kievskiy-marshala-jukova-prospekt__74619084fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-kievskiy-marshala-jukova-prospekt__74619087fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-kievskiy-marshala-jukova-prospekt__74619092fl.jpg","htt