(86, 9126668, ' ДОМ СДАН В ЭКСПЛУАТАЦИЮ. КОСТАНДИ №', 'empty_', 913812, 'грн', 23431, 1, 39, 7, 14, 'Не определено', 'Одесса', 'Киевский', 'КОСТАНДИ №162 - КОРОЛЁВА', 'ДОМ СДАН В ЭКСПЛУАТАЦИЮ. КОСТАНДИ № 162. \nСАМЫЙ ЦЕНТР КИЕВСКОГО РАЙОНА.\nНовый 14-ти этажный кирпичный дом.\nСдан в эксплуатацию в 1 квартале 2017 года \nОбщая площадь 39 кв.м.\nКомната 19 кв.м,Кухня-10 кв.м.\nДОМ ВЫГОДНО ОТЛИЧАЕТСЯ ОТ СВОИХ КОНКУРЕНТОВ ЗАРЕКОМЕНДОВАВШИМ СЕБЯ ВЫСОКИМ КАЧЕСТВОМ СТРОИТЕЛЬСТВА.\nСостояние от строителей.\nВысококачественные металлопластиковые окна и двери,отштукатурены стены,\nзаведена медная проводка,радиаторы с терморегуляторами,входная бронированная дверь.\nПодземный паркинг,круглосуточная охрана и обслуживание комплекса,кондоминиум,система видеонаблюдения.\nБлагоустроенная охраняемая территория,детские площадки.\nНадежная компания,построила в Киевском р-не 8 домов.\nЕсть предложение от компании квартиры сданных кирпичных домах.\nСтоимость квартиры в сданном кирпичном доме на 7-м этаже- 34 999 уе. \nОФОРМЛЕНИЕ ДОКУМЕНТОВ -0%.\nОТДЕЛ ПРОДАЖ.7993157,0974828433.\nУБЕДИТЕЛЬНАЯ ПРОСЬБА !! \nПОСРЕДНИКОВ и СОТРУДНИКОВ АГЕНСТВА НЕДВИЖИМОСТИ НЕ БЕСПОКОИТЬ. \nБольшое спасибо за понимание !!!', 'Состояние', 'кирпич', 'Не определено', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-kievskiy-kostandi-162--korolva-9126668.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-kievskiy-kostandi-162--korolva__37746924fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-kievskiy-kostandi-162--korolva__37746942fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-kievskiy-kostandi-162--korolva__37746944fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-kievskiy-kostandi-162--korolva__37746946fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prod