(91, 9689001, ' Дом сдан! Жилой комплекс Золотая Эра.\nЖК', 'empty_', 1132637, 'грн', 19197, 2, 59, 2, 9, 'Вторичный рынок', 'Одесса', 'Поселок Котовского', 'Южная дорога / Крыжановка.', 'Дом сдан! Жилой комплекс Золотая Эра.\nЖК состоит из 12-ти домов переменной этажности от 5-ти до 9-ти. Монолитный железобетонный каркас с несущими колоннами.\nЗдания легко выдержат нормативную сейсмическую нагрузку, равную 7 баллам. Кровля – рулонная плоская.\nИсточником теплоснабжения служит индивидуальная газовая котельная оборудованная котлами европейской компании «WIESSMANN». ', 'Состояние', 'монолит', 'Частного лица', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-poselok-kotovskogo-yujnaya-doroga---kryijanovka-9689001.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-yujnaya-doroga---kryijanovka__42485311fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-yujnaya-doroga---kryijanovka__52066296fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-yujnaya-doroga---kryijanovka__52066301fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-yujnaya-doroga---kryijanovka__52066305fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-yujnaya-doroga---kryijanovka__52066309fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-yujnaya-doroga---kryijanovka__52066311fl.jpg"]', '2015-03-13 16:24:16', NULL, NULL, NULL, NULL),
