(123, 13549308, ' СРОЧНО !  БЕЗ дополнительной комиссии', 'empty_', 644909, 'грн', 16536, 1, 39, 7, 17, 'Новостройки', 'Одесса', 'Поселок Котовского', 'Академика Сахарова улица', 'СРОЧНО !  БЕЗ дополнительной комиссии и затрат на оформление. Дом сдан ! 600 $ м2 (есть варианты различной площади)\nОдна из ПОСЛЕДНИХ однокомнатных квартир от застройщика!\nОбщая площадь квартиры 39 кв м.\nВо дворе дома будет расположена детская площадка и обустроены зоны для отдыха и ожидания. Современные парадные, собственная служба безопасности и эксплуатации. По всему периметру дома, а также на этажах, установлены камеры видеонаблюдения.\nКомплекс оснащён грузовыми и пассажирскими скоростными лифтами OTIS.\nЦена с ОФОРМЛЕНИЕМ, без дополнительных затрат !\nЗВОНИТЕ СЕЙЧАС, есть варианты различной площади !', 'Состояние', 'монолитно-каркасный', 'Бизнес', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-poselok-kotovskogo-akademika-saharova-ulitsa-13549308.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-akademika-saharova-ulitsa__77880772fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-akademika-saharova-ulitsa__77880777fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-akademika-saharova-ulitsa__77880779fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-akademika-saharova-ulitsa__77880781fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-akademika-saharova-ulitsa__77880783fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-akademika-saharova-ulitsa__77880786fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-p