(131, 11466107, ' ДОМ СДАН В ЭКСПЛУАТАЦИЮ,ДОКУМЕНТЫ ГОТОВЫ НА', 'empty_', 869452, 'грн', 16404, 0, 53, 1, 2, 'Новостройки', 'Одесса', 'Центр', 'старопортофранковская/ водный и строительный университет.', 'ДОМ СДАН В ЭКСПЛУАТАЦИЮ,ДОКУМЕНТЫ ГОТОВЫ НА КВАРТИРУ.\nПОДУМАЙТЕ О СВОИХ  СТУДЕНТАХ И  ДЕТЯХ !!!\nГород.Одесса,ул.10 АПРЕЛЯ/ ДИДРИХСОНА.\nРайон  Водного и строительного университета,морской академии.\n СТАТУС  КВАРТИРЫ, Одесская прописка.\n2-х ком. Квартира в  центре площадью 53 кв.м.- 33 300 уе.- ЭТО РЕАЛЬНОСТЬ!!!\nВЫБОР ЭТАЖА И ПЛАНИРОВКИ ОГРАНИЧЕН.\nНовый дом  из крымского ракушечника. Автономная котельная в доме.\nРядом зеленые насаждения, на своей территории ряд торговых точек.\nБез проблем добираться до любой части города благодаря хорошей инфраструктуре. \nМесторасположение объекта наряду с удобством выезда к крупным магистралям города, сочетает в себе значительную площадь озеленения и благоприятную экологическую обстановку. \nВ районе располагаются: рынок, торговые центры, культурно-развлекательные комплексы, спортивные клубы, школы и детские сады, различные медицинские учреждения. \nСТОИМОСТЬ КВАРТИРЫ ( состояние от строителей) — 33 300 уе.\nВОЗМОЖНА ПОКУПКА  с капитальным ремонтом( МПО- Германия,импортная облицовка в сан/узле,пол-ламинат-плитка,радиаторы,разведена электрика,сантехника, поклеены импортные обои,внутренняя столярка,натяжные французские потолки,входная бронированная дверь,не требует замены).\nОСТАНЕТЕСЬ ДОВОЛЬНЫ качеством ремонта от компании.\nОФОРМЛЕНИЕ ДОКУМЕНТОВ-0%. \nПредварительная запись на просмотр квартиры \nПн-Пт.с 10.00-18.00,Сб.10.00.-16.00.Вск.-выходной. \n  Отдел продаж строительной компании.\nПОСРЕДНИКОВ и СОТРУДНИКОВ АГЕНСТВА НЕДВИЖИМОСТИ НЕ БЕСПОКОИТЬ. \nБольшое спасибо за понимание !!!', 'Состояние', 'ракушечник (ракушняк)', 'Бизнес', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-komnata-odessa-ilichevskiy-staroportofrankovskaya--vodnyiy-i-stroitelnyiy-universitet-11466107.html', 'DomRia', '["https:\\/\\/cdn.