(140, 11465627, ' ПОЛУЧИТЕ СКИДКУ ПРИ ПОКУПКЕ-2 500 уе.', 'empty_', 18258485, 'грн', 869451, 1, 21, 1, 2, 'Новостройки', 'Одесса', 'Приморский', 'Десятого апреля улица', 'ПОЛУЧИТЕ СКИДКУ ПРИ ПОКУПКЕ-2 500 уе. \nДОМ СДАН В ЭКСПЛУАТАЦИЮ,\nМОЖНО ВЫПОЛНЯТЬ РЕМОНТ В СВОЕЙ КВАРТИРЕ.\nг.Одесса, ул.10 АПРЕЛЯ/ ДИДРИХСОНА.\nРайон  Водного и строительного университета,морской академии.\n СТАТУС  КВАРТИРЫ, Одесская прописка.\n2-х ком. Квартира в  центре города,площадью 53 кв.м-33 300 уе.с учётом скидки 2 500 уе.\nПЕРВЫЙ ВЗНОС-50%.\nРАССРОЧКА  до 12 месяцев,БЕЗ СПРАВОК О ДОХОДАХ.\nНовый дом  из крымского ракушечника.\nАвтономная котельная в доме.\nРядом зеленые насаждения, на своей территории ряд торговых точек.\nБез проблем добираться до любой части города благодаря хорошей инфраструктуре. \nМесторасположение объекта наряду с удобством выезда к крупным магистралям города, сочетает в себе значительную площадь озеленения и благоприятную экологическую обстановку. \nВ районе располагаются: рынок, торговые центры, культурно-развлекательные комплексы, спортивные клубы, школы и детские сады, различные медицинские учреждения. \nКвартира с капитальным ремонтом( МПО- Германия,импортная облицовка в сан/узле,пол-ламинат-плитка,радиаторы,разведена электрика,сантехника, поклеены импортные обои,внутренняя столярка,натяжные французские потолки,входная бронированная дверь,не требует замены).\nОСТАНЕТЕСЬ ДОВОЛЬНЫ качеством ремонта от компании.\nОФОРМЛЕНИЕ ДОКУМЕНТОВ-0%. \nПредварительная запись на просмотр квартиры \nПн-Пт.с 10.00-17.00,Сб.10.00.-15.00.Вск.-выходной. \nУБЕДИТЕЛЬНАЯ ПРОСЬБА !!\nПОСРЕДНИКОВ и СОТРУДНИКОВ АГЕНСТВА НЕДВИЖИМОСТИ НЕ БЕСПОКОИТЬ.\n Большое спасибо за понимание !!!', 'Состояние', 'ракушечник (ракушняк)', 'Бизнес', '********', '********', 'https://dom.ria.com/ru/realty-perevireno-prodaja-kvartira-odessa-primorskiy-desyatogo-aprelya-ulitsa-11465627.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-primor