(141, 12820025, ' Новое предложение от строительной компании. Суворовский', 'empty_', 387728, 'грн', 19386, 1, 20, 3, 9, 'Новостройки', 'Одесса', 'Суворовский', 'Николаевская дорога', 'Новое предложение от строительной компании. Суворовский р-н. Лузановка. \nВы устали платить за съемную квартиру,есть выход для вас. \nКвартира с рассрочкой платежа при первом взносе -30%,остаток платежа на 18 месяцев без справок о доходах. \nКвартиры идеально подходят для молодых семей и студентов. \nКвартира в пешей доступности 5ти минут до моря.\nСостояние от строителей. МПО немецкий профиль,идеальные стены подготовлены под поклейку обоев,стяжка- под укладку ламината,все коммуникации заведены в квартиру,приборы учёта на воду,электронные приборы на свет. \nВходная бронированная дверь.\nСистема безопасности и сохранности  имущества(видеонаблюдение в доме и на площадке).\nКрышная котельная в доме.Студийный вариант.Отличное предложение для молодых семей и студентов!  \nОтличное  транспортное сообщение. \nСдача дома в эксплуатацию сентябрь 2017 года.\nC 15 июля строительная компания даёт возможность выполнять ремонт в своей квартире.\nСтатус квартиры,одесская прописка. \nСтоимость квартиры – 14 850 уе. \nПервый взнос-30%,остаток на 18 месяцев без справок о доходах. \nОформление документов – 0%. \nОтдел продаж строительной компании. \nПредварительная запись на просмотр квартиры \nПн-Пт.с 10.00-18.00,Сб.10.00.-15.00.Вск.-выходной.\nУБЕДИТЕЛЬНАЯ ПРОСЬБА !!\nПОСРЕДНИКОВ и СОТРУДНИКОВ АГЕНСТВА НЕДВИЖИМОСТИ НЕ БЕСПОКОИТЬ.\n Большое спасибо за понимание !!!', 'Состояние', 'кирпич', 'Бизнес', '********', '********', 'https://dom.ria.com/ru/realty-perevireno-prodaja-kvartira-odessa-suvorovskiy-nikolaevskaya-doroga-12820025.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-suvorovskiy-nikolaevskaya-doroga__71665262fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-suvorov