(145, 13108694, ' Дом сдан в эксплуатацию,можно выполнять ремонт', 'empty_', 483003, 'грн', 17889, 0, 27, 2, 6, 'Новостройки', 'Одесса', 'Суворовский', 'Андреевского улица', 'Дом сдан в эксплуатацию,можно выполнять ремонт в своей квартире.\nПересыпский дом.\nНовый 6-ти этажный кирпичный дом с лифтом фирмы “Otis”. \nВы устали платить за съемную квартиру,есть выход для вас.\n Квартира с рассрочкой платежа при первом взносе -30%,остаток платежа на 1.5 года. \nКвартира идеально подходит для молодых семей и студентов. \nКвартира 1 комн. - от 16 кв.м.-35 кв.м. \nСостояние от строителей. \nНовые коммуникации. Отличное предложение для студентов! Рядом более 5-ти ВУЗов, удобное транспортное сообщение,до центра города всего в 5-ти минутах езды общественным транспортом. \nСдача дома в эксплуатацию,т.е подключение всех коммуникаций в  апреле 2017 года.Статус квартиры,одесская прописка. \nДокументы полностью готовы для проведения сделки. Нотариальная сделка,договор купли-продажи. \nСтоимость квартиры площадью 27 кв.м -18 499 уе.\n Первый взнос-30%.остаток на 1.5 года,без справок о доходах. Оформление документов – 0%. \nОтдел продаж.\nПредварительная запись на просмотр квартиры \nПн-Пт.с 10.00-18.00,Сб.10.00.-15.00.Вск.-выходной.\nУБЕДИТЕЛЬНАЯ ПРОСЬБА !!\nПОСРЕДНИКОВ и СОТРУДНИКОВ АГЕНСТВА НЕДВИЖИМОСТИ НЕ БЕСПОКОИТЬ. \nБольшое спасибо за понимание !!!', 'Состояние', 'Не определено', 'Бизнес', '********', '********', 'https://dom.ria.com/ru/realty-perevireno-prodaja-komnata-odessa-suvorovskiy-andreevskogo-ulitsa-13108694.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-komnata-odessa-suvorovskiy-andreevskogo-ulitsa__73756016fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-komnata-odessa-suvorovskiy-andreevskogo-ulitsa__73756017fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-komnata-odessa-suvorovskiy-andreevskogo-ulitsa__76623689fl.jpg","h