(152, 13108711, ' Дом сдан в эксплуатацию,можно выполнять ремонт', 'empty_', 306789, 'грн', 18046, 1, 17, 2, 6, 'Новостройки', 'Одесса', 'Суворовский', 'Андреевского улица', 'Дом сдан в эксплуатацию,можно выполнять ремонт в своей квартире.\nПересыпский дом. \nНовый 6-ти этажный кирпичный дом с лифтом фирмы  “Otis”. \nВы устали платить за съемную квартиру,есть выход для вас. \nКвартира с рассрочкой платежа при первом взносе -30%,остаток платежа на 1.5 года. \nКвартира идеально подходит для молодых семей и студентов. Квартира 1 комн. - от 16 кв.м.-35 кв.м. Состояние от строителей. Новые коммуникации. \nРядом более 5-ти ВУЗов, удобное транспортное сообщение,до центра города всего в 5-ти минутах езды общественным транспортом. \nСдача дома в эксплуатацию,т.е подключение всех коммуникаций в  апреле 2017 года. \nСтатус квартиры,одесская прописка. \nДокументы полностью готовы для проведения сделки. Нотариальная сделка,договор купли-продажи. \nСтоимость квартиры 17кв.м -11 750 уе. \nПервый взнос-30%.остаток на 1.5 года,без справок о доходах. \nОформление документов – 0%. \nОтдел продаж.\nПредварительная запись на просмотр квартиры \nПн-Пт.с 10.00-18.00,Сб.10.00.-15.00.Вск.-выходной.\nУБЕДИТЕЛЬНАЯ ПРОСЬБА !!\nПОСРЕДНИКОВ и СОТРУДНИКОВ АГЕНСТВА НЕДВИЖИМОСТИ НЕ БЕСПОКОИТЬ. \nБольшое спасибо за понимание !!!', 'Состояние', 'кирпич', 'Бизнес', '********', '********', 'https://dom.ria.com/ru/realty-perevireno-prodaja-kvartira-odessa-suvorovskiy-andreevskogo-ulitsa-13108711.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-suvorovskiy-andreevskogo-ulitsa__73756078fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-suvorovskiy-andreevskogo-ulitsa__73756083fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-suvorovskiy-andreevskogo-ulitsa__76623288fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom