(178, 13609420, ' Квартира с красивой , правильной планировкой', 'empty_', 731070, 'грн', 18276, 1, 40, 14, 15, 'Вторичный рынок', 'Одесса', 'Киевский', 'Академика Королева улица', 'Квартира с красивой , правильной планировкой 40 метров квадратных ,\n10-ти метровая кухня с выходом на 5-ти метровую лоджию из которой открывается прекрасный вид на город и море \nогромная комната 24 метра где хорошо уместится встроенный шкаф или гардеробная .\nДом Сдан и заселен находится на Королева угол Левитана\nинтерьер проект ', 'Состояние', 'кирпич', 'Частного лица', '********', '********', 'https://dom.ria.com/ru/realty-perevireno-prodaja-kvartira-odessa-kievskiy-akademika-koroleva-ulitsa-13609420.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-kievskiy-akademika-koroleva-ulitsa__78492700fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-kievskiy-akademika-koroleva-ulitsa__78492701fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-kievskiy-akademika-koroleva-ulitsa__78492702fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-kievskiy-akademika-koroleva-ulitsa__78492704fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-kievskiy-akademika-koroleva-ulitsa__78492705fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-kievskiy-akademika-koroleva-ulitsa__78492706fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-kievskiy-akademika-koroleva-ulitsa__78492710fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-kievskiy-akademika-koroleva-ulitsa__78492711fl.jpg"]', '2017-07-20 09:35:31', NULL, NULL, NULL, NULL),
(179, 13604687, ' Предлагается к продаже 1-комнатная квартира в', 'empty_', 783290, 'грн', 16318, 1, 48, 3, 10, 'Вторичный рынок', 'Одесса', 'Червоный Хутор', 'Центральная улица', 'Предлагается к продаже 1-комнатная квартира в экологически чистом районе г. Одессы - проспект Жукова/&quot;Метро&quot;-&quot;Эпицентр&quot;, 3 этаж нового и заселённого 10-этажного дома из красного кирпича (все коммуникации подключены). Общая площадь 48 м: комната 20 м, кухня 14 м с выходом на лоджию, просторный холл-прихожая 9 м с гардеробной. Метраж квартиры предполагает возможность перепланировки в двухкомнатную. Своя кладовая с окном на этаже (узаконена). Чистейшая парадная, лифт работает. Огороженная придомовая территория, облагороженная озеленением и детской площадкой. Рядом детсад, школа, два супермаркета, продовольственный рынок, транспорт. Супер предложение эконом-класса!', 'Состояние', 'кирпич', 'Бизнес', '********', '********', 'https://dom.ria.com/ru/realty-perevireno-prodaja-kvartira-odessa-chervonyiy-hutor-tsentralnaya-ulitsa-13604687.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-chervonyiy-hutor-tsentralnaya-ulitsa__78452457fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-chervonyiy-hutor-tsentralnaya-ulitsa__78452458fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-chervonyiy-hutor-tsentralnaya-ulitsa__78548950fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-chervonyiy-hutor-tsentralnaya-ulitsa__78548952fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-chervonyiy-hutor-tsentralnaya-ulitsa__78548954fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-perevireno-prodaja-kvartira-odessa-chervonyiy-hutor-tsentralnaya-ulitsa__78548956fl.jpg"]', '2017-