(181, 13618004, ' Продам 2-х комнатную квартиру Французский б-р.', 'empty_', 2428198, 'грн', 31535, 2, 77, 6, 23, 'Вторичный рынок', 'Одесса', 'Приморский', 'Французский бульвар', 'Продам 2-х комнатную квартиру Французский б-р. д.26/Шампанского пер. Квартира находится на 6-м этаже 23-х этажного дома построенного фирмой Стикон .Общая площадь 76,4 кв.м. Данная квартира легко перепланировать в кухню гостиную площадью 22 кв.м. с балконом и две спальни площадью 11 и 19 кв.м. Квартира без ремонта. Двухсторонняя окна выходят в сторону Французского б-ра. и пр-та Шевченко (Восток и Запад ).\nЦена 93.000 у.е.', 'Состояние', 'пеноблок', 'Бизнес', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-primorskiy-frantsuzskiy-bulvar-13618004.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-frantsuzskiy-bulvar__78580560fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-frantsuzskiy-bulvar__78580571fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-frantsuzskiy-bulvar__78580576fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-frantsuzskiy-bulvar__78580577fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-frantsuzskiy-bulvar__78580690fl.jpg"]', '2017-07-22 19:55:57', NULL, NULL, NULL, NULL),
(182, 13617843, ' Продам 3-х комн. квартиру на Днепропетровской', 'empty_', 913838, 'грн', 14505, 3, 63, 8, 9, 'Вторичный рынок', 'Одесса', 'Поселок Котовского', 'Днепропетровская дорога', 'Продам 3-х комн. квартиру на Днепропетровской дороге, второй ряд домов. Рядом детский сад и 7 гимназия. Две отдельный спальни, гостиная и кухня. Качественные метало-пластиковые окна и деревянные межкомнатные двери.Два балкона-застеклены. Большой санузел - 6 м. Нуждается в легком косметическом ремонте. Чистая продажа, прописанных нет. Фото реальные. \nОформление - 0%.', 'Состояние', 'панель', 'Частного лица', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-poselok-kotovskogo-dnepropetrovskaya-doroga-13617843.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-dnepropetrovskaya-doroga__78577814fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-dnepropetrovskaya-doroga__78577815fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-dnepropetrovskaya-doroga__78577816fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-dnepropetrovskaya-doroga__78577817fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-dnepropetrovskaya-doroga__78577818fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-dnepropetrovskaya-doroga__78577819fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-dnepropetrovskaya-doroga__78577820fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-dnepropetrovskaya-doroga__78577821fl.jpg","https:\\/\\/cdn.riastatic.com\\/photos