(185, 431439446, 'Продается гостинка', '000000000', 646643, 'грн', 19595, 1, 33, 9, 9, 'Вторичный рынок', 'Ильичевск', 'Не определен', NULL, 'Продается светлая, просторная однокомнатная гостинка на девятом этаже, девятиэтажного кирпичного дома. Квартира после косметического ремонта,  балкон застеклен, есть кондиционер. Кухня оборудована встроенной мебелью, плита с электрической духовкой. Бойлер, стояк заменен на пластиковый, все трубы пластик.  Дверь бронированная, окна МТП, выходят во двор. Во дворе детская и спортивна площадки. Рядом три супермаркета, рынок «Вечерний», недалеко две школы, три детских сада. Хорошая транспортная развязка.', 'Состояние', '', 'Частного лица', '********', '********', 'https://www.olx.ua/obyavlenie/prodaetsya-gostinka-IDtch6K.html', 'OLX', '["https:\\/\\/olxua-ring04.akamaized.net\\/images_slandocomua\\/497360790_1_644x461_prodaetsya-gostinka-ilichevsk.jpg","https:\\/\\/olxua-ring04.akamaized.net\\/images_slandocomua\\/497360790_2_644x461_prodaetsya-gostinka-fotografii.jpg","https:\\/\\/olxua-ring04.akamaized.net\\/images_slandocomua\\/497360790_3_644x461_prodaetsya-gostinka-vtorichnyy-rynok.jpg","https:\\/\\/olxua-ring04.akamaized.net\\/images_slandocomua\\/497360790_4_644x461_prodaetsya-gostinka-nedvizhimost.jpg","https:\\/\\/olxua-ring04.akamaized.net\\/images_slandocomua\\/497360790_5_644x461_prodaetsya-gostinka-odesskaya-oblast.jpg","https:\\/\\/olxua-ring04.akamaized.net\\/images_slandocomua\\/497360790_6_644x461_prodaetsya-gostinka-.jpg","https:\\/\\/olxua-ring04.akamaized.net\\/images_slandocomua\\/497360790_7_644x461_prodaetsya-gostinka-.jpg","https:\\/\\/olxua-ring04.akamaized.net\\/images_slandocomua\\/497360790_8_644x461_prodaetsya-gostinka-.jpg","https:\\/\\/olxua-ring04.akamaized.net\\/images_slandocomua\\/497360790_9_644x461_prodaetsya-gostinka-.jpg"]', '2017-07-22 18:58:46', NULL, NULL, NULL, NULL),
