(208, 422974820, 'Продам свою 3х комнатную квартиру с ремонтом от хозяина возле "Семьи"', '000000000', 1317080, 'грн', 17561, 3, 75, 2, 12, 'Вторичный рынок', 'Одесса', ' Суворовский', NULL, 'Продам отличную трехкомнатную квартиру от хозяина возле "Семьи" Днепропетровская дорога/Заболотного, поселок Котовского. В квартире выполнен качественный ремонт с использованием дорогих материалов. Остается много мебели и техники.\r\nТри комнаты, кухня, гардеробная, раздельный санузел, кладовка на этаже.\r\nТри балкона, один раскрыт и объединен с комнатой, два других нет. Все балконы застеклены. Снаружи квартира утеплена. Квартира под охраной.\r\nВ доме ОСМД, стоят счетчики на тепло. Чистый светлый подъезд, на 1ом этаже консъерж. 2 лифта. Хорошие соседи.\r\nДокументы купли-продажи. Дети не прописаны.\r\nОтличное расположение дома, рядом ТЦ Семья, школы и детские садики. Рядом отделение новой почты и укрпочты.\r\nЯвляюсь собственником данной квартиры, без оплаты посреднических услуг.', 'Состояние', '', 'Частного лица', '********', '********', 'https://www.olx.ua/obyavlenie/prodam-svoyu-3h-komnatnuyu-kvartiru-s-remontom-ot-hozyaina-vozle-semi-IDsCL4v.html', 'OLX', '["https:\\/\\/olxua-ring12.akamaized.net\\/images_slandocomua\\/485884424_1_644x461_prodam-svoyu-3h-komnatnuyu-kvartiru-s-remontom-ot-hozyaina-vozle-semi-odessa_rev022.jpg","https:\\/\\/olxua-ring12.akamaized.net\\/images_slandocomua\\/485884424_4_644x461_prodam-svoyu-3h-komnatnuyu-kvartiru-s-remontom-ot-hozyaina-vozle-semi-nedvizhimost_rev022.jpg","https:\\/\\/olxua-ring12.akamaized.net\\/images_slandocomua\\/485884424_6_644x461_prodam-svoyu-3h-komnatnuyu-kvartiru-s-remontom-ot-hozyaina-vozle-semi-_rev022.jpg","https:\\/\\/olxua-ring12.akamaized.net\\/images_slandocomua\\/485884424_10_644x461_prodam-svoyu-3h-komnatnuyu-kvartiru-s-remontom-ot-hozyaina-vozle-semi-_rev022.jpg","https:\\/\\/olxua-ring12.akamaized.net\\/images_slandocomua\\/485884424_2_644x461_prodam-svoyu-3h-komnatnuyu-kvartiru-s-remontom-ot-hozyaina-vozl